                case RecordTypeInts.BODT:
                case RecordTypeInts.BOD2:
                {
                    ArmorBinaryCreateTranslation.FillBinaryBodyTemplateCustom(
                        frame: frame.SpawnWithLength(frame.MetaData.Constants.SubConstants.HeaderLength + contentLength),
                        item: item);
